    public function symbolViewBox()
    {
        return '0 0 700 700';
    }

    protected function renderStyles()
    {
        return sprintf(
            '.foreground-0 {
            transform: translate(-5%%, 34%%) scale(1.7);
        }

        #%2$s path {
            transform: scale(0.75);
        }
        
        #%3$s {
            fill: none;
            stroke: %4$s;
        }

        .foreground-1 {
            mask: url(#%s);
        }
        
        #%5$s path:nth-child(2), 
        #%5$s path:nth-child(3) {
            transform: scale(0.75);
        }
        
        ',
            $this->maskId(),
            $this->symbolId(),
            $this->frameId(),
            $this->qrcode->design->frameColor,
            'symbol-frame-' . $this::$shapeId,
        );
    }

    protected function frameStrokeWidth()
    {
        return 6;
    }

    protected function modifiedViewBox()
    {
        return sprintf(
            '%1$s %1$s %2$s %2$s',
            $this->output->size * -2,
            $this->output->size * 6
        );
    }
